import React from 'react';
import logo from './logo.svg';
import m1 from './mockup2.png';
import m2 from './mockup.png'
import './App.css';
import stepper from './stepper.js';
import appbar from './appbar.js';
import select from './select.js';
import scroll from './scroll.js'
import check from './check.js'

function App(){
  return (
    <div className="App">

      <div>
          {scroll()}
        </div>
        <div>
          {appbar()}
        </div>
      <div>
          {stepper()}
        </div>
        <div>
          {select()}
        </div>
        <div>
          {check()}
        </div>
        <div>
          m1
        </div>
    </div>
  );
}

export default App;
